DROP DATABASE IF EXISTS `Restaurant`; 
CREATE DATABASE `Restaurant`; 
USE `Restaurant`; 
SHOW TABLES; 

DROP TABLE IF EXISTS `Waiters`; 
CREATE TABLE `Waiters` (
id_Waiters INT primary key not null auto_increment unique, 
Name CHAR(45) not null); 
 




DROP TABLE IF EXISTS `Group`; 
CREATE TABLE `Group` ( 
id_Group INT primary key not null auto_increment unique, 
Name_group CHAR(45) not null); 
 




DROP TABLE IF EXISTS `Ingredients`; 
CREATE TABLE `Ingredients` ( 
id_Ingredients INT primary key not null auto_increment unique, 
Names CHAR(45) not null, 
cost_price int not null, 
Unit_of_measurement int not null); 
 




DROP TABLE IF EXISTS `Dishes`; 
CREATE TABLE `Dishes` ( 
id_Dishes INT primary key not null auto_increment unique, 
Names CHAR(45) not null, 
Group_id int not null, 
Interview CHAR(225), 
Price int not null, 
Extra_charge int not null, 
foreign key (Group_id) references `Group` (id_Group)); 
 




DROP TABLE IF EXISTS `The_composition_of_the_dish`; 
CREATE TABLE `The_composition_of_the_dish` ( 
id_The_composition_of_the_dish INT primary key not null auto_increment unique, 
Ingredient_id int not null, 
Dishes_id int not null, 
Quantity int, 
cost_price INT not null, 
foreign KEY (Ingredient_id) REFERENCES `Ingredients` (id_Ingredients), 
foreign key (Dishes_id) references `Dishes` (id_Dishes)); 
 




DROP TABLE IF EXISTS `Orders`; 
CREATE TABLE `Orders` ( 
id_Orders INT primary key not null auto_increment unique, 
Order_date DATE, 
Table_number int not null, 
Waiters_id INT not NULL, 
Total_amount int not null, 
foreign key (Waiters_id) references `Waiters` (id_Waiters)); 
 




DROP TABLE IF EXISTS `Drinks`; 
CREATE TABLE `Drinks` ( 
id_Drinks INT primary key not null auto_increment unique, 
Names CHAR(50), 
Group_id int not null, 
cost_price INT not NULL, 
Price int not null, 
Extra_charge int not null, 
foreign key (Group_id) references `Group` (id_Group)); 
 




DROP TABLE IF EXISTS `Order_from_the_menu`; 
CREATE TABLE `Order_from_the_menu` ( 
id_Order_from_the_menu INT primary key not null auto_increment unique, 
Orders_id int not null, 
Dishes_id int not null, 
Drinks_id int not null, 
Quantity INT, 
The_amount int not null, 
foreign KEY (Orders_id) REFERENCES `Orders` (id_Orders), 
foreign key (Dishes_id) references `Dishes` (id_Dishes), 
foreign key (Drinks_id) references `Drinks` (id_Drinks));



